import { StyleSheet } from 'react-native';
const Styles = StyleSheet.create({
  container: {
    height: '100%',
    paddingHorizontal: 16,
    backgroundColor: '#F8F9FB'
  },
  block:{
    paddingVertical: 16,
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: "#FFF",
    color: '#333',
    marginTop: 12,
    paddingHorizontal: 16,
    marginBottom: 12,
    fontSize: 14
  }
});

export default Styles
